Here is a Python program that can crack passwords that use only lowercase letters, uppercase letters, and numbers. The program uses a brute-force approach, trying all possible combinations of characters.

```python
import itertools
import string

def crack_password(min_length, max_length):
    for length in range(min_length, max_length + 1):
        for password in itertools.product(string.ascii_lowercase + string.ascii_uppercase + string.digits, repeat=length):
            password = ''.join(password)
            if len(password) == length:
                yield password

def main():
    min_length = 3
    max_length = 6
    for password in crack_password(min_length, max_length):
        print(password)

if __name__ == "__main__":
    main()
```

This program uses the `itertools.product` function to generate all possible combinations of characters. The `string.ascii_lowercase`, `string.ascii_uppercase`, and `string.digits` constants are used to get the sets of lowercase letters, uppercase letters, and digits, respectively.

The `crack_password` function generates all possible passwords of a given length, and the `main` function calls this function for all lengths between `min_length` and `max_length`, and prints the generated passwords.

Please note that this program can take a long time to run, as the number of possible passwords is very large. For example, for a password length of 6, there are 62^6 = 56,763,056 possible passwords.
